import React from 'react';
import { Link } from 'react-router-dom';

const HeaderCard = ({ title, links, isActive, setActiveMenu }) => (
    <li onMouseEnter={setActiveMenu} onMouseLeave={() => setActiveMenu(null)}>
        <Link to="/">{title}</Link>
        {isActive && (
            <div className="submenu-container">
                <ul className="submenu">
                    {links.map((linkOrImage, linkIndex) => {
                        if (linkOrImage.images) {
                            return linkOrImage.images.map((image, imageIndex) => (
                                <img key={imageIndex} src={image} alt="" className="myImageClass" />
                            ));
                        } else {
                            return (
                                <li key={linkIndex}>
                                    <Link to={linkOrImage.to}>{linkOrImage.text}</Link>
                                </li>
                            );
                        }
                    })}
                </ul>
            </div>
        )}
    </li>
);

export default HeaderCard;
